import './App.css';
import MyNavbar from './navbar';  // Use MyNavbar instead of myNav if needed
import Banner from './banner';   // Add this line
import Contents from './section';
import Section from './content-section';
import ContentSection from './content';
import Footer from './footer';  // Add this line
import Gallery from './gallery';
function App() {
  return (
    <div>
      {/* navbar */}
      <MyNavbar />
      {/* banner */}
      <Banner />
      {/* section */}
      <Contents/>
      {/* content section */}
      <Section/>
      {/* <br/>
      <br/> */}
      {/* section contents */}
      <ContentSection/>
      {/* <br/>
      <br/> */}
      {/* <br/> */}
      {/* gallery */}
      <Gallery/>
      <Footer />
    </div>
  );
}

export default App;
